import React from 'react';
import PropTypes from 'prop-types';

const Header = ({ title }) => {
  // const onClick = () => {
  //     console.log('click')
  // }
  return (
    <header className="header">
      <h1>{title}</h1>
      <div id="navigation">
        <a class="nav-item"href="#about-me">About Me</a>
        <a class="nav-item"href="#work">Work</a>
        <a class="nav-item"href="#contact-me">Contact</a>
        <a class="nav-item" href="https://docs.google.com/document/d/14yti_k0GQCLeKrqTCVWKKsfx3TdvEYrY/edit">
          Resume
        </a>
      </div>
    </header>
  );
};

Header.defaultProps = {
  title: 'Daniel Bradley',
};

Header.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Header;
